webpackJsonp([0xea258e625c3a],{7858:function(e,t){e.exports={data:{post:{html:'<p><a href="http://shoppero.com/"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2007/04/shoppero.png" alt="shoppero" align="right" title="shoppero" /></a>Nico\'s <a href="http://lumma.de/eintrag.php?id=3407">confirmed</a> the <a href="http://ecommerce.typepad.com/exciting_ecommerce/2007/04/shoppero.html">rumor</a>, he\'s <a href="http://www.basicthinking.de/blog/2007/04/27/warum-shoppero-lumma-nach-hamburg-zog/">coming back</a> to Hamburg to lead a new startup called <a href="http://shoppero.com/">Shoppero</a>. And here I was all set to start a counter-rumor that he was really coming to Hamburg to start working for us.</p>\n<p>I did some initial systems consulting for the project (OK, it was more like "Can you set up a server for us?" "Sure, no problem."), so I\'ve been in on the secret. And note that they have a .com domain rather than .de. Their plans for world domination are not limited to the German-speaking world.</p>\n<p>Another tidbit: the project has been blogging under a code name in English for several weeks, but the rumormongers don\'t seem to have found it yet. :-)</p>',fields:{title:"Cat's Out of the Bag",date:"27 Apr 2007",url:"https://papascott.de/2007-04-27-cats-out-of-the-bag/"}}},pathContext:{slug:"/2007-04-27-cats-out-of-the-bag/",prev:{fields:{title:"American Power Conversion Kit",date:"27 Apr 2007",slug:"/2007-04-27-american-power-conversion-kit/"}},next:{fields:{title:"Corruption and Locusts",date:"27 Apr 2007",slug:"/2007-04-27-corruption-and-locusts/"}}}}}});
